interface SOPHONSOAR {
    /**
     * 用于触发运行剧本或响应命令。
     */
    TriggerSophonPlaybook(query: TriggerSophonPlaybookRequest): Promise<TriggerSophonPlaybookResponse>;
    /**
     * 用于获取处置实体的命令。
     */
    DescribeSophonCommands(query: DescribeSophonCommandsRequest): Promise<DescribeSophonCommandsResponse>;
    /**
     * 用于配置自动响应计划时，获取可执行的剧本列表。
     */
    DescribeExecutePlaybooks(query: DescribeExecutePlaybooksRequest): Promise<DescribeExecutePlaybooksResponse>;
    /**
     * 用于获取某一组件的资产信息列表。
     */
    DescribeComponentAssets(query: DescribeComponentAssetsRequest): Promise<DescribeComponentAssetsResponse>;
    /**
     * 校验Python代码片段的语法是否正确。
     */
    VerifyPythonFile(query: VerifyPythonFileRequest): Promise<VerifyPythonFileResponse>;
    /**
     * 用于提交一段python3的代码片段并执行，只能用于数据处理。
     */
    RunPython3Script(query: RunPython3ScriptRequest): Promise<RunPython3ScriptResponse>;
    /**
     * 当一个组件需要配置资产时，该接口用户修改组件的资产信息。
     */
    ModifyComponentAsset(query: ModifyComponentAssetRequest): Promise<ModifyComponentAssetResponse>;
    /**
     * 获取去重后的剧本发布的版本信息列表。
     */
    DescribeDistinctReleases(query: DescribeDistinctReleasesRequest): Promise<DescribeDistinctReleasesResponse>;
    /**
     * 用于删除组件配置的资产信息。
     */
    DeleteComponentAsset(query: DeleteComponentAssetRequest): Promise<DeleteComponentAssetResponse>;
    /**
     * 在提交pyhton脚本的任务后，通过返回的requestUuid来获取运行日志。
     */
    DescriberPython3ScriptLogs(query: DescriberPython3ScriptLogsRequest): Promise<DescriberPython3ScriptLogsResponse>;
    /**
     * 用于获取组件的资产元信息，即资产信息是由哪些字段组成的。
     */
    DescribeComponentAssetForm(query: DescribeComponentAssetFormRequest): Promise<DescribeComponentAssetFormResponse>;
    /**
     * 校验剧本的配置是否正确，编排的逻辑是否合理。
     */
    VerifyPlaybook(query: VerifyPlaybookRequest): Promise<VerifyPlaybookResponse>;
    /**
     * 用户在编排剧本过程中，使用该接口可重命名剧本中某一节点的名称，对该节点的引用路径也会随之改变。
     */
    RenamePlaybookNode(query: RenamePlaybookNodeRequest): Promise<RenamePlaybookNodeResponse>;
    /**
     * 用于批量修改剧本的启用与停止状态。
     */
    BatchModifyInstanceStatus(query: BatchModifyInstanceStatusRequest): Promise<BatchModifyInstanceStatusResponse>;
    /**
     * 用于获取产品全局的，通用的配置信息。
     */
    DescribeField(query: DescribeFieldRequest): Promise<DescribeFieldResponse>;
    /**
     * 用于获取剧本中，某一节点正在被哪些节点引用。
     */
    DescribeNodeUsedInfos(query: DescribeNodeUsedInfosRequest): Promise<DescribeNodeUsedInfosResponse>;
    /**
     * 用于编排剧本时，组件输入的可引用路径。
     */
    DescribeNodeParamTags(query: DescribeNodeParamTagsRequest): Promise<DescribeNodeParamTagsResponse>;
    /**
     * 用于获取组件输出的历史数据。
     */
    DescribePlaybookNodesOutput(query: DescribePlaybookNodesOutputRequest): Promise<DescribePlaybookNodesOutputResponse>;
    /**
     * 用于获取某一云产品OpenAPI接口的接口名称列表。
     */
    DescribePopApiItemList(query: DescribePopApiItemListRequest): Promise<DescribePopApiItemListResponse>;
    /**
     * 用于获取某一云产品OpenAPI接口的版本信息。
     */
    DescribePopApiVersionList(query: DescribePopApiVersionListRequest): Promise<DescribePopApiVersionListResponse>;
    /**
     * 用于获取OpenAPI的产品列表。
     */
    DescribeApiList(query: DescribeApiListRequest): Promise<DescribeApiListResponse>;
    /**
     * 用于获取OpenAPI的接口详情。
     */
    DescribePopApi(query: DescribePopApiRequest): Promise<DescribePopApiResponse>;
    /**
     * 用于把剧本配置发布线上，发布后，剧本会以新的逻辑来运行。
     */
    PublishPlaybook(query: PublishPlaybookRequest): Promise<PublishPlaybookResponse>;
    /**
     * 用于修改剧本的配置信息。
     */
    ModifyPlaybook(query: ModifyPlaybookRequest): Promise<ModifyPlaybookResponse>;
    /**
     * 用于修改剧本的输入参数与输出参数。
     */
    ModifyPlaybookInputOutput(query: ModifyPlaybookInputOutputRequest): Promise<ModifyPlaybookInputOutputResponse>;
    /**
     * 用于获取用户可以使用的预定义组件列表。
     */
    DescribeComponentPlaybook(query: DescribeComponentPlaybookRequest): Promise<DescribeComponentPlaybookResponse>;
    /**
     * 用于获取剧本的输入参数与输出参数的配置信息。
     */
    DescribePlaybookInputOutput(query: DescribePlaybookInputOutputRequest): Promise<DescribePlaybookInputOutputResponse>;
    /**
     * 用于比较发布的两个版本的剧本配置信息。
     */
    ComparePlaybooks(query: ComparePlaybooksRequest): Promise<ComparePlaybooksResponse>;
    /**
     * 用于触发已启用的自定义剧本或预定义剧本。
     */
    TriggerPlaybook(query: TriggerPlaybookRequest): Promise<TriggerPlaybookResponse>;
    /**
     * 当用户执行剧本任务后，通过该接口可获取组件动作的输入数据与输出数据。
     */
    DescribeSoarRecordInOutput(query: DescribeSoarRecordInOutputRequest): Promise<DescribeSoarRecordInOutputResponse>;
    /**
     * 用于调试运行剧本。
     */
    DebugPlaybook(query: DebugPlaybookRequest): Promise<DebugPlaybookResponse>;
    /**
     * 用于获取用户可使用的普通组件的列表。
     */
    DescribeComponentList(query: DescribeComponentListRequest): Promise<DescribeComponentListResponse>;
    /**
     * 用于获取剧本的执行记录列表。
     */
    DescribeSoarRecords(query: DescribeSoarRecordsRequest): Promise<DescribeSoarRecordsResponse>;
    /**
     * 用于获取剧本的一次运行过程中，组件的执行记录列表。
     */
    DescribeSoarTaskAndActions(query: DescribeSoarTaskAndActionsRequest): Promise<DescribeSoarTaskAndActionsResponse>;
    /**
     * 用于根据剧本最新一次的执行记录，动态生成剧本各节点的输出结构信息。
     */
    DescribeLatestRecordSchema(query: DescribeLatestRecordSchemaRequest): Promise<DescribeLatestRecordSchemaResponse>;
    /**
     * 用于获取剧本的xml配置信息。
     */
    DescribePlaybook(query: DescribePlaybookRequest): Promise<DescribePlaybookResponse>;
    /**
     * 用于获取组件的JS文件，组件会以返回的JS文件来进行页面的渲染。
     */
    DescribeComponentsJs(query: DescribeComponentsJsRequest): Promise<DescribeComponentsJsResponse>;
    /**
     * 用于获取剧本发布的线上版本的信息列表。
     */
    DescribePlaybookReleases(query: DescribePlaybookReleasesRequest): Promise<DescribePlaybookReleasesResponse>;
    /**
     * 获取某一剧本的元信息，包括名字、描述、运行次数、失败率等。
     */
    DescribePlaybookMetrics(query: DescribePlaybookMetricsRequest): Promise<DescribePlaybookMetricsResponse>;
    /**
     * 用于回滚剧本到指定的版本，同时可以指定回滚时是否发布该版本。
     */
    RevertPlaybookRelease(query: RevertPlaybookReleaseRequest): Promise<RevertPlaybookReleaseResponse>;
    /**
     * 用于创建一个初始化的剧本。
     */
    CreatePlaybook(query: CreatePlaybookRequest): Promise<CreatePlaybookResponse>;
    /**
     * 用于获取响应编排产品的统计信息，包含剧本数量、启用数量等内容。
     */
    DescribePlaybookNumberMetrics(query: DescribePlaybookNumberMetricsRequest): Promise<DescribePlaybookNumberMetricsResponse>;
    /**
     * 用于修改剧本的启动与停止状态。
     */
    ModifyPlaybookInstanceStatus(query: ModifyPlaybookInstanceStatusRequest): Promise<ModifyPlaybookInstanceStatusResponse>;
    /**
     * 用于删除指定的自定义剧本。
     */
    DeletePlaybook(query: DeletePlaybookRequest): Promise<DeletePlaybookResponse>;
    /**
     * 用于获取剧本列表。
     */
    DescribePlaybooks(query: DescribePlaybooksRequest): Promise<DescribePlaybooksResponse>;
    /**
     * 用于获取剧本任务中，某一组件执行动作时，输出的数据列表。
     */
    DescribeSoarRecordActionOutputList(query: DescribeSoarRecordActionOutputListRequest): Promise<DescribeSoarRecordActionOutputListResponse>;
    /**
     * 用于一次性获取所有的剧本列表。
     */
    QueryTreeData(query: QueryTreeDataRequest): Promise<QueryTreeDataResponse>;
    /**
     * 用户在使用响应编排的功能进行事件处置时，处置中心会生成相应的处置任务，该接口用于对生成的处置任务执行后续的解除封禁、重试封禁、解除隔离等动作。
     */
    TriggerProcessTask(query: TriggerProcessTaskRequest): Promise<TriggerProcessTaskResponse>;
    /**
     * 用于获取产品需要的一些枚举信息。
     */
    DescribeEnumItems(query: DescribeEnumItemsRequest): Promise<DescribeEnumItemsResponse>;
    /**
     * 用户在使用响应编排的功能进行事件处置时，处置中心会生成相应的处置任务，该接口用于获取处置任务的列表信息。
     */
    DescribeProcessTasks(query: DescribeProcessTasksRequest): Promise<DescribeProcessTasksResponse>;
}
export default SOPHONSOAR;
